Answer: There are multiple ways to think about the bubble sort. If you look at it from the perspective of how much time do I need to sort a given array of numbers, you only spend 2n time, one to go to the beginning, one to go to the end, one for every two numbers in the array. If your array is small enough that you don't use swap often, there is an asymptotic lower bound of O (2n) for the running time.

Of course this only gets you close to an O (n) solution, but how close is depends on what you mean by an O (n) algorithm.

If you assume that the array has some sequence structure (it sorted in order, or all numbers less or equal to some other number), then you can only process two adjacent entries in constant time, regardless of what you do. So in the worst case for any algorithm to "process" an array, you spend n+1 time and if you want to do it in constant time, you are only left with 1 step in the worst case. Hence O (1).

For a general algorithm that accepts a list of numbers and sorts it, even when run on sorted numbers you have a lower bound is O (n) (for sorting n numbers, you need n comparisons on the worst case.
